--
-- Struttura della tabella `indirizzi`
--

CREATE TABLE IF NOT EXISTS `indirizzi` (
  `codice` varchar(4) NOT NULL,
  `nome` varchar(130) NOT NULL,
  `settore` varchar(3) NOT NULL,
  `biennio` varchar(4) DEFAULT NULL,
  `anno_inizio` smallint(6) NOT NULL,
  `durata` smallint(6) NOT NULL,
  `percorso_quadriennale` bit(1) NOT NULL,
  `classificazione` char(2) DEFAULT NULL,
  `settore_und` bit(1) DEFAULT NULL,
  `attivo` bit(1) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

